void print_ring(Ring_int* r, const char* label) {
    if (r == ((void *)0)) {
        printf("%-30s | (NULL Ring Pointer)\n", label);
        return;
    }
    printf("%-30s | Size: %-2zu | Cap: %-2zu | Head: %-2zu | Tail: %-2zu | Content: ",
           label, r->vec->size, r->vec->capacity, r->head, r->tail);

    if (r->functions->empty(r)) {
        printf("(empty)\n");
        return;
    }


    for (size_t i = 0; i < r->functions->size(r); ++i) {
        size_t index = (r->head + i) % r->vec->capacity;
        printf("%d ", r->vec->arr[index]);
    }
    printf("\n");
}


void test_ring() {
    printf("===== Comprehensive Ring Buffer<int> Test Suite =====\n\n");


    printf("--- 1. FIFO Behavior (push_back / pop_front) ---\n");
    Ring_int* fifo = ring_new_ring_1_int();
    print_ring(fifo, "Initial State");

    fifo->functions->push_back(fifo, 10);
    fifo->functions->push_back(fifo, 20);
    fifo->functions->push_back(fifo, 30);
    print_ring(fifo, "After 3 push_backs");
    (__builtin_expect(!(*(fifo->functions->front(fifo)) == 10), 0) ? __assert_rtn(__func__, "test_ring.h", 43, "front(fifo) == 10") : (void)0);
    (__builtin_expect(!(*(fifo->functions->back(fifo)) == 30), 0) ? __assert_rtn(__func__, "test_ring.h", 44, "back(fifo) == 30") : (void)0);
    (__builtin_expect(!(fifo->functions->size(fifo) == 3), 0) ? __assert_rtn(__func__, "test_ring.h", 45, "size(fifo) == 3") : (void)0);

    fifo->functions->pop_front(fifo);
    print_ring(fifo, "After 1 pop_front");
    (__builtin_expect(!(*(fifo->functions->front(fifo)) == 20), 0) ? __assert_rtn(__func__, "test_ring.h", 49, "front(fifo) == 20") : (void)0);

    fifo->functions->pop_front(fifo);
    fifo->functions->pop_front(fifo);
    print_ring(fifo, "After 2 more pop_fronts");
    (__builtin_expect(!(fifo->functions->empty(fifo) == 1), 0) ? __assert_rtn(__func__, "test_ring.h", 54, "empty(fifo) == 1") : (void)0);
    printf("FIFO OK.\n\n");


    printf("--- 2. Wrap-Around Behavior ---\n");


    fifo->functions->push_back(fifo, 1);
    fifo->functions->push_back(fifo, 2);
    fifo->functions->push_back(fifo, 3);
    fifo->functions->push_back(fifo, 4);
    print_ring(fifo, "Filled to capacity (4)");

    fifo->functions->pop_front(fifo);
    fifo->functions->pop_front(fifo);
    print_ring(fifo, "Popped two from front");

    fifo->functions->push_back(fifo, 5);
    fifo->functions->push_back(fifo, 6);
    print_ring(fifo, "Pushed two to back (wrapped)");
    (__builtin_expect(!(*(fifo->functions->front(fifo)) == 3), 0) ? __assert_rtn(__func__, "test_ring.h", 74, "front(fifo) == 3") : (void)0);
    (__builtin_expect(!(*(fifo->functions->back(fifo)) == 6), 0) ? __assert_rtn(__func__, "test_ring.h", 75, "back(fifo) == 6") : (void)0);
    (__builtin_expect(!(fifo->functions->size(fifo) == 4), 0) ? __assert_rtn(__func__, "test_ring.h", 76, "size(fifo) == 4") : (void)0);
    printf("Wrap-around OK.\n\n");


    printf("--- 3. Reallocation While Wrapped ---\n");
    fifo->functions->push_back(fifo, 7);
    print_ring(fifo, "Pushed to trigger realloc");
    (__builtin_expect(!(fifo->functions->size(fifo) == 5), 0) ? __assert_rtn(__func__, "test_ring.h", 83, "size(fifo) == 5") : (void)0);
    (__builtin_expect(!(*(fifo->functions->front(fifo)) == 3), 0) ? __assert_rtn(__func__, "test_ring.h", 84, "front(fifo) == 3") : (void)0);
    (__builtin_expect(!(*(fifo->functions->back(fifo)) == 7), 0) ? __assert_rtn(__func__, "test_ring.h", 85, "back(fifo) == 7") : (void)0);


    int expected[] = {3, 4, 5, 6, 7};
    for (size_t i = 0; i < fifo->functions->size(fifo); ++i) {
        size_t index = (fifo->head + i) % fifo->vec->capacity;
        (__builtin_expect(!(fifo->vec->arr[index] == expected[i]), 0) ? __assert_rtn(__func__, "test_ring.h", 91, "fifo->vec->arr[index] == expected[i]") : (void)0);
    }
    printf("Reallocation while wrapped OK.\n\n");


    printf("--- 4. Push Front / Pop Back ---\n");
    print_ring(fifo, "Current state");
    fifo->functions->push_front(fifo, 2);
    fifo->functions->push_front(fifo, 1);
    print_ring(fifo, "After two push_fronts");
    (__builtin_expect(!(*(fifo->functions->front(fifo)) == 1), 0) ? __assert_rtn(__func__, "test_ring.h", 101, "front(fifo) == 1") : (void)0);

    fifo->functions->pop_back(fifo);
    print_ring(fifo, "After pop_back");
    (__builtin_expect(!(*(fifo->functions->back(fifo)) == 6), 0) ? __assert_rtn(__func__, "test_ring.h", 105, "back(fifo) == 6") : (void)0);
    printf("Push front / Pop back OK.\n\n");


    ring_delete_ring_int(fifo);
    printf("Cleanup OK.\n");

    printf("\n===== Test Suite Complete =====\n");
}
# 6 "test.c" 2

int main(void) {




    test_ring();
    return 0;
}
